/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"works-wrapper\">\n  <p class=\"works-wrapper__title\" tabindex=\"0\">{{'How Civis Works' | translate}}</p>\n  <p class=\"works-wrapper__subtitle\" tabindex=\"0\">\n    {{'In India, you are the superhero of the country, and the guardian of our destiny.' | translate}} <br />\n    {{'Laws meant for you and I can be shaped by people like you and I.' | translate }} <br />\n    {{'The process where you share feedback with the government on how a policy may impact you and your community, is known as a public consultation.' | translate}}\n  </p>\n  <div class=\"works-wrapper__step-section mt-5\">\n    <p class=\"step-section-title\" tabindex=\"0\">{{'Submit A Response' | translate}}</p>\n    <div class=\"step-grid\">\n      <picture>\n        <source srcset=\"assets/images/step1.webp\" type=\"image/webp\">\n        <source srcset=\"assets/images/step1.jpg\" type=\"image/jpeg\">\n        <img class=\"step-img\" src=\"assets/images/step1.jpg\" alt=\"\" />\n      </picture>\n      <div>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step One: Select A Consultation' | translate}}</p>\n          <li tabindex=\"0\">\n            {{'On Civis, you will find all the draft documents which the Government wants your feedback on.\n            Select a consultation to get started!' | translate}}\n          </li>\n          <li tabindex=\"0\">{{\"Can’t find a consultation you know about on Civis? Why don’t you add it in!\" | translate}}</li>\n          <button class=\"app-btn primary mt-2\" (click)=\"scrollToResponses()\">{{'Add A Consultation' | translate}}</button>\n        </ul>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Two: Read The Summary' | translate}}</p>\n          <li tabindex=\"0\">\n            {{\"We know sometimes laws and policies can get intimidating, but don’t worry, we have you covered! Read a summary of the document in simple English, and if you’d like,go through the full document to know more.\" | translate}}\n          </li>\n        </ul>\n      </div>\n    </div>\n\n    <div class=\"step-grid\">\n      <picture>\n        <source srcset=\"assets/images/step3.webp\" type=\"image/webp\">\n        <source srcset=\"assets/images/step3.jpg\" type=\"image/jpeg\">\n        <img class=\"step-img\" src=\"assets/images/step3.jpg\" alt=\"\" />\n      </picture>\n      <div>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Three: Discuss The Document' | translate}}</p>\n          <li tabindex=\"0\">\n            {{\"Never shy away from asking questions, our community is here to answer them all! Go to the ‘Discuss & Engage’ tab to ask questions and share your thoughts. Remember, discussing a document is not the same as sending a response to the Government.\" | translate}}\n          </li>\n        </ul>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Four: Choose A Response Or Write Your Own' | translate}}</p>\n          <li tabindex=\"0\">\n            {{'Once you have all your questions answered, submit your response through the ‘Read & Respond’ tab.\n            If you feel passionately about a document, you can make your response a public response,\n            for others to use too. If you’re not too sure what to write, you can choose other people’s responses to use as your own!' | translate}}\n          </li>\n        </ul>\n      </div>\n    </div>\n\n\n    <div class=\"step-grid\">\n      <picture>\n        <source srcset=\"assets/images/step4.webp\" type=\"image/webp\">\n        <source srcset=\"assets/images/step4.jpg\" type=\"image/jpeg\">\n        <img class=\"step-img\" src=\"assets/images/step4.jpg\" alt=\"\" />\n      </picture>\n      <div>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Five: Submit Your Response!' | translate}}</p>\n          <li tabindex=\"0\">\n            {{'Don’t forget, once your response is submitted, you won’t be able to edit it again, so type wisely! Civis will submit your response onward to the government. If you haven’t chosen to make your response public, your name and personal details will not be shown to the government, if your response is public, only your first name will be shown along with your response.' | translate}}\n          </li>\n        </ul>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Six: Share Your Super-Citizen Status!' | translate}}</p>\n          <li tabindex=\"0\">{{'Excited to share your super-citizen status with friends and family? We are too, spread the word!' | translate}}</li>\n        </ul>\n      </div>\n    </div>\n  </div>\n\n  <div class=\"works-wrapper__step-section\" #addConultationSection>\n    <p class=\"step-section-title\" tabindex=\"0\">{{'Add A Consultation' | translate}}</p>\n    <div class=\"step-grid\">\n      <picture>\n        <source srcset=\"assets/images/step2.webp\" type=\"image/webp\">\n        <source srcset=\"assets/images/step2.jpg\" type=\"image/jpeg\">\n        <img class=\"step-img\" src=\"assets/images/step2.jpg\" alt=\"\" />\n      </picture>\n      <div>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step One: Stumbled Upon A Consultation?' | translate}}</p>\n          <li tabindex=\"0\">\n            {{'Well done champ! Congratulations on finding a consultation to share with our community.\n            If you’ve found a consultation on a government website, be sure to share it with us,\n            so that others active citizens can share their feedback too.\n            Confused about what a consultation is? Read this document on consultations from the Ministry of Law & Justice.' | translate}}\n          </li>\n        </ul>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Two: Click On ‘Submit A Consultation’' | translate}}</p>\n          <li tabindex=\"0\">{{'We need a few details from you to help us out and we’ll be good to go!' | translate}}</li>\n        </ul>\n      </div>\n    </div>\n\n    <div class=\"step-grid\">\n      <picture>\n        <source srcset=\"assets/images/step4.webp\" type=\"image/webp\">\n        <source srcset=\"assets/images/step4.jpg\" type=\"image/jpeg\">\n        <img class=\"step-img\" src=\"assets/images/step4.jpg\" alt=\"\" />\n      </picture>\n      <div>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Three: Add A Few Details To Help Us Out' | translate}}</p>\n          <li tabindex=\"0\">\n            {{'We need a few details from you like the document title and deadline.\n            Also, don’t forget to share the link to the document, from the official website of the government.\n            This helps us get back to you quickly with the simplified document.' | translate}}\n          </li>\n        </ul>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Four: Select The Department' | translate}}</p>\n          <li tabindex=\"0\">\n            {{'When you select the department the consultation is from, you help us share feedback with the right people.\n            If you can’t find the department in the dropdown menu, be sure to add it.' | translate}}\n          </li>\n          <button class=\"app-btn primary mt-2\" [routerLink]=\"['/consultations/new']\">\n            {{'Add a department page' | translate}}\n          </button>\n        </ul>\n        <ul class=\"step-points\">\n          <p class=\"step-number\" tabindex=\"0\">{{'Step Five: Submit The Consultation' | translate}}</p>\n          <li tabindex=\"0\">\n            {{'When you hit submit, our moderators will go through the Consultation and make it public in a few hours.\n            We try to work as fast as possible, check back soon to be the first person to submit your feedback on the document!' | translate}}\n          </li>\n        </ul>\n      </div>\n    </div>\n  </div>\n</div>\n<app-footer></app-footer>\n");

